import { Fragment } from "react";

// styles
import "./styles.scss";

const Wallpaper = ({ setWallpaper }) => {
  function setStars() {
    setWallpaper("stars");
    console.log("stars was clicked");
  }

  function setGreen() {
    setWallpaper("green");
  }

  return (
    <Fragment>
      <div className="wallpaper-content">
        <h3>Select Wallpaper</h3>
        <button onClick={setGreen}><img src="/icon/green-background.png" alt="green-background"></img></button>
        <button onClick={setStars}>
          <img src="/icon/" alt=""/>
        </button>
      </div>
    </Fragment>
  );
};

export default Wallpaper;
